import React, { useState } from "react";

const HeaderComponent = () => {
  const [isClicked, setIsClicked] = useState(false);

  return (
    <div>
      <header className="header">
        <nav>
          <div>
            <button type="radio" onClick={() => setIsClicked(!isClicked)}></button>
                      <li>Employee</li>
                      <li>Postion</li>
                      <li>Location</li>
                      <li>Salary</li>
                      <li>Actions</li>
                      {isClicked && (
                          <div></div>
                      )}
          </div>
        </nav>
      </header>
    </div>
  );
};

export default HeaderComponent;
